import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';

class Sidebar extends React.Component {
    render() {
        return(
            <div class="sidenav">
                <a href="#header">Autistic</a>
                <a href="#section1">About</a>
                <a href="#section2">Application</a>
                <a href="#contact">Contact</a>
            </div>
        );
    }
}

class Main extends React.Component {
    render() {
        return(
            <div id = "text">
                <div id = "header" class = "content">
                    <p>AUTISTIC</p>
                </div>
                <div id = "section1" class = "content">
                    <p>ABOUT</p>
                </div>
                <div id = "section2" class = "content">
                    <p>APPICATION</p>
                </div>
                <div id = "contact">
                    <footer>
                        <address>
                            Created by Kritsana Khankaew (BKK)<br/>
                            Faculty of Engineering, Chulalongkorn University<br/>
                            E-mail: kridsana.khunkaew@gmail.com
                        </address>
                    </footer>

                </div>
            </div>

        );
    }
}

class Display extends React.Component {
    render(){
        return(
            <div>
                <Sidebar/>
                <Main/>
            </div>
        );
    }
}

ReactDOM.render(<Display />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
